// game
var g = {
    "init": function() {
        var t0 = window.performance.now();
        console.log("qiba started...");

        // subs
        // dom init, base64 decode
        // console.log(noto);
        dom.init();
        bmp.init();
        sce.init();

        // loop
        g.tick = 0;
        g.id = window.setInterval(g.bun, 1000);

        // stats
        console.log("total render time: " + (window.performance.now() - t0) + "ms.");
    },
    "bun": function() {
        console.log("tick count: " + g.tick);
        if (g.tick >= bmp.b.length) {
            console.log("finished render!");
            window.clearInterval(g.id);
            return;
        }
        // render
        ren.pole();
        g.tick = g.tick + 1;
    }
}
// scene
var sce = {
    "init": function() {
        sce.a = dom.canvas([1920,1080,0,0]);
        sce.b = dom.canvas([1024,1024,448,28]);
        // each glyph bitmap is 64x64
        // pixel size of 16
        // total grid size is 1024x1024
        dom.add(sce.a);
        dom.add(sce.b);
        sce.a.can.addEventListener("click", sce.click, false);
        sce.b.can.addEventListener("click", sce.click, false);
        sce.a.can.dataset.x = "a";
        sce.b.can.dataset.x = "b";
        sce.data();
    },
    "click": function(e) {
        console.log(e);
    },
    "data": function() {
        // init db
        sce.db = {};
        sce.db["a"] = [];
        sce.db["b"] = [];
    },
    "arc": function() {
        // expand grid
        // single glyph cell 64x64
        // width count = 16
        // pane width = 1024, margin width = 28
        // height count = 30
    }
}
// render
var ren = {
    "pole": function() {
        sce.a.con.fillStyle = rgba.rand();
        sce.a.con.fillRect(0,0,sce.a.can.width,sce.a.can.height);
        sce.b.con.fillStyle = rgba.rand();
        sce.b.con.fillRect(0,0,sce.b.can.width,sce.b.can.height);
        sce.b.con.fillStyle = rgba.rand();
        // glyph
        var d0 = bmp.b[g.tick];
        var d1 = bmp.a[d0];
        // console.log(d0,d1,d1.length);
        for (var i = 0; i < d1.length; i++) {
            if (d1[i] == 0) {
                continue;
            }
            var x0 = i % 64;
            var y0 = (i / 64) >>> 0;
            var x1 = (x0 * 16) >>> 0;
            var y1 = (y0 * 16) >>> 0;
            sce.b.con.fillRect(x1,y1,16,16);
        }
        // single call to render
        // glyph in input cell
    },
    "cell": function(k0, r0, c0) {
        // input rect should be multiple of 64x64
        // input key found in 91 glyph db
        var d0 = bmp.a[k0];
        var w0 = (r0[0] / 64) >>> 0;
        var h0 = (r0[1] / 64) >>> 0;
        // rand, can set to monochrome
        var rgba0 = rgba.rand();
        var rgba1 = rgba.rand();
        for (var i = 0; i < d0.length; i++) {
            if (d0[i] == 0) {
                c0.con.fillStyle = rgba0;
            } else {
                c0.con.fillStyle = rgba1;
            }
            var x0 = i % 64;
            var y0 = (i / 64) >>> 0;
            var x1 = (x0 * w0) >>> 0;
            var y1 = (y0 * h0) >>> 0;
            var x2 = (x1 + r0[2]) >>> 0;
            var y2 = (y1 + r0[3]) >>> 0;
            c0.con.fillRect(x2,y2,w0,h0);
        }
    }
}
// bitmaps
var bmp = {
    "init": function() {
        bmp.a = {};
        bmp.b = [];
        for (var k in noto) {
            // console.log(k, noto[k]);
            var b0 = noto[k];
            var b1 = base64DecToArr(b0);
            // console.log(k, b1);
            bmp.a[k] = bmp.exp(b1);
            bmp.b.push(k);
        }
        // console.log(bmp.b);
        // console.log(bmp.b.length);
        // 91 characters total
    },
    "exp": function(b0) {
        // expansion of uint8array
        // to bit strings
        var r0 = [];
        for (var i = 0; i < b0.length; i++) {
            var b1 = b0[i];
            var b2 = binStr(b1);
            for (var j = 0; j < 8; j++) {
                var b3 = b2.charAt(j);
                var b4 = parseInt(b3, 10);
                r0.push(b4);
            }
        }
        return r0;
    }
}
// dom
var dom = {
    "init": function() {
        dom.alpha = document.getElementById("alpha");
        console.log(dom.alpha);
    },
    "canvas": function(r0) {
        var c0 = {};
        c0.can = document.createElement("canvas");
        c0.con = c0.can.getContext("2d");
        c0.can.width = r0[0];
        c0.can.height = r0[1];
        c0.can.style.position = "absolute";
        c0.can.style.top = r0[3] + "px";
        c0.can.style.left = r0[2] + "px";
        return c0;
    },
    "add": function(c0) {
        dom.alpha.appendChild(c0.can);
    },
    "remove": function(c0) {
        dom.alpha.removeChild(c0.can);
    }
}
// colors
var rgba = {
    "rc": function() {
        // return random rgba
        var c0 = [
            rgba.rb(),
            rgba.rb(),
            rgba.rb(),
            1.0
            ];
        return c0;
    },
    "css": function(c0) {
        // return css string
        return "rgba(" + c0.join(",") + ")";
    },
    "rb": function() {
        // random byte
        return (Math.random() * 255) >>> 0;
    },
    "rba": function(size0) {
        // random byte array length of input
        var r0 = [];
        for (var i = 0; i < size0; i++) {
            r0.push(rgba.rb());
        }
        return r0;
    },
    "rand": function() {
        return rgba.css(rgba.rc());
    },
    "mono": function(c0) {
        return rgba.css([c0,c0,c0,1.0]);
    },
    "rmon": function() {
        var c0 = rgba.rb();
        return rgba.mono(c0);
    }
}
